import { useState } from "react";
function App()
{
    const [count, setCount] = useState(0);
    const onclickHandler = (e) =>{
        setCount(Number(count+1));
    }
    
    return (
        <>
            <h2>hello world</h2>
            <p>count : {count}</p>
            <button onClick={onclickHandler}>증가하기 </button>
        </>
    )
}

export default App;
